    Inclination, and Intensity, That Can Be Used to Track the Magnetic Pole and Continent
    Movements",nt"tracking_summary": {ntt"total": 6,ntt"recent": 0nt},nt"groups":
    [],nt"relationships_as_subject": [],nt"revision_timestamp": "2015-09-26T21:46:52.507644",nt"name":
    "values-about-ancient-magnetic-poles-declination-inclination-and-intensity-that-can-be-used-to-t",nt"isopen":
    false,nt"url": null,nt"notes": "The study of magnetism is one of the oldest
    of the geophysical sciences. It is unique among the sciences in that ancient records
    of the geomagnetic field are preserved in rocks and changes in the field can be
    traced through time. To assist the scientist studying the Earth's ancient magnetization,
    the National Geophysical Data Center (NGDC) has available the following data of
    paleopole positions and paleomagnetic directions. The Global PaleoMagnetic Directions
    and Poles Data Base (GPMDB) Version 3.1 revised May 1995. This data base, established
    by M. McElhinny and J. Lock under the authority of the International Association
    of Geomagnetism and Aeronomy (IAGA), contains all published data up to 1995 and
    has references linked to data results. The data base was developed under MicroSoft
    Access 2.0 and includes following information: AUTHORS, Table of authors, linked
    to REFERENCE and ROCKUNIT The REFERENCE, Table of books, journals etc. from which
    data were extracted ROCKUNIT, position, geology, age, and structure information
    PMAGRESULT, results, reversal test, lab test, tilt corrections and comments ALTRESULT,
    pole position and statistics where derived from VGP FIELDTESTS, type of field tests
    done and results with commentary Several other related data bases are available
    including Paleointensity (PALIN), Polarity Transitions (TRANS), and Secular Variation
    (SECVR).",nt"license_title": null,nt"extras": [{ntt"key": "bbox-east-long",ntt"value":
